public class Solution {
    private const int MOD = 1000000007;

    private int SumOfDigits(string s) {
        int sum = 0;
        foreach (var c in s) sum += c - '0';
        return sum;
    }

    private int CountLessThanOrEqual(string num, int maxSum) {
        int n = num.Length;
        int[,,] dp = new int[n + 1, maxSum + 1, 2];
        dp[0, 0, 1] = 1;

        for (int i = 0; i < n; i++) {
            int digit = num[i] - '0';
            for (int sum = 0; sum <= maxSum; sum++) {
                for (int k = 0; k < 10; k++) {
                    if (sum + k <= maxSum) {
                        dp[i + 1, sum + k, 0] = (dp[i + 1, sum + k, 0] + dp[i, sum, 0]) % MOD;
                        if (k < digit) {
                            dp[i + 1, sum + k, 0] = (dp[i + 1, sum + k, 0] + dp[i, sum, 1]) % MOD;
                        } else if (k == digit) {
                            dp[i + 1, sum + k, 1] = (dp[i + 1, sum + k, 1] + dp[i, sum, 1]) % MOD;
                        }
                    }
                }
            }
        }

        int result = 0;
        for (int sum = 0; sum <= maxSum; sum++) {
            result = (result + dp[n, sum, 0] + dp[n, sum, 1]) % MOD;
        }
        return result;
    }

    public int Count(string num1, string num2, int minSum, int maxSum) {
        int lessThanNum1 = CountLessThanOrEqual(num1, maxSum) - CountLessThanOrEqual(num1, minSum - 1);
        int lessThanNum2 = CountLessThanOrEqual(num2, maxSum) - CountLessThanOrEqual(num2, minSum - 1);
        return (lessThanNum2 - lessThanNum1 + MOD) % MOD;
    }
}
